- proto: BookBase
  entities:
  - uid: 6887
    components:
    - type: Transform
      rot: 12.566370614359172 rad
      pos: 37.432465,31.054848
      parent: 818
    - type: Paper
      content: >-
        "Do better and Do good" That's what I've always been told, what I've always heard, What I try to follow. The truth is I'm scared of fucking up. I freeze at the thought of knowing I could ruin everything so I don't choose to do the right thing. It scares to me to know that my choice matters. - XX/XX/XX


        Someone I didn't know smiled at me. I hate it. They always put me off guard. What did I do to deserve that. Why are you smiling at me. Stop smiling at me. Stop. - XX/XX/XX


        I saw my friend today. Her smile is the only smile that makes me feel special. It makes me feel warm. I feel awful she loves someone like me. She should hate me.

        XX/XX/XX


        I did something awful today. I'm sorry. I'm sorry II -


        Today they put me with a new therapist. They're a robot. They say it's more reliable to speak with than another living being. Said it's name is "KARMA". Absurd. But I'm willing to follow through. I want to be fixed. - XX/XX/XX


        It gave me a recorder. Said it's better for me. "Recording your thoughts are better than writing them down." It then went on to cite his sources. It was annoying. I already I hate this thing. - XX/XX/XX


        They said I was going to a new station. Apparently it could be another form of therapy. It said I was "Complicated" and needed more... "Physical" ways to let out my frustrations. I suppose getting paid is nice as well. For what it's worth. But so soon after... I wonder if this will be a bad idea. - XX/XX/XX


        I don't know how I'm alive. I know I fell. I know I should've let myself die but... but then a white light came through. I woke up. I saw the captain and everyone else gathered around me. They thought I was a goner. Everyone looked sad for me. The moth lady hugged me. I was nothing but dead weight. So why save me? - XX/XX/XX


        I came back. I had turned into a fish but to the captains genius (Or stupid luck) had turned me back. I think I won't eat carp for a good while. Hamburgers are back on the menu for me... I suppose. - XX/XX/XX


        That mercenary reminds me of someone a lot. Someone I wasn't too fond of... I wonder if he'll come back some day. - XX/XX/XX


        Therapy went on for longer than anticipated. So long in fact that I missed my shuttle. KARMA said it was fine. "We have much more to discuss". Apparently they were specifically mandated towards me. No one else had appointments with them. The session was nice. I think I'm making progress... I hope. - XX/XX/XX
